    <div><p>While few truly independent travelers look forward in rapt anticipation to a guided tour, many will admit to a pang of curiosity (or, as the times would have it, FOMO) when they overhear a gifted guide explaining the history and context of a place. Even those who love wandering around on their own have likely experienced the benefits of an intimate small-group tour with a local expert.</p>
         <p>If this seems familiar at all, and you are considering hiring a guide on an upcoming trip, here are some questions to ask before booking a tour.</p>
